import string

input = ""

for index, char in enumerate(input):
    if index >= 3:
        chunk = input[index-4:index]
        if (len(set(chunk)) == 4):
            print(f"part 1: {index}")
            break

for index, char in enumerate(input):
    if index >= 13:
        chunk = input[index-14:index]
        if (len(set(chunk)) == 14):
            print(f"part 2: {index}")
            break
